import React from "react";

function Preference() {
  return (
    <div>
      <div className="container">
        <a href="/">
          <img src="images/backArrow.png" alt="Back" className="back" width="30" height="30" />
        </a>
        <h2>Your Preferences</h2>
      </div>
      <p>Please confirm your selection</p>

      <div className="info">
        <div className="preference-item">
          <h3>Special Dietary Requirements</h3>
          <p className="backwork">None</p>
        </div>
        {/* Repeat the above structure for other preference items */}
      </div>

      <div className="button-container">
        <button className="confirm-button">Confirm Choices</button>
        <button className="redo-button">Redo</button>
      </div>
    </div>
  );
}

export default Preference;
